import React from "react";
import "./home.scss";

const Home = () => {
  return (
    <div>
      <section className="first-section">
        <h1 className="firstName">Jakob</h1>
        <h1 className="lastName">Persson</h1>
      </section>
      <section></section>
    </div>
  );
};

export default Home;
